import React from "react";
import "./App.css";
import { BrowserRouter, Route, Switch, Link } from "react-router-dom";
import Home from './content/Home'
import AboutMe from './content/AboutMe'
import ContactMe from "./content/ContactMe";
import Hobbies from "./content/Hobbies";
import Projects from "./content/Projects";
import WorkHistory from "./content/WorkHistory";
import NavBar from "./components/NavBar";
import Button from '@material-ui/core/Button';

const Footer = () => {
  return <div id ="footer"><Link to="/"><Button variant="contained" color="secondary">
      Home
    </Button></Link>
    <Link to="/aboutme"><Button variant="contained" color="secondary">
      About Me
    </Button></Link>
    <Link to="/projects"><Button variant="contained" color="primary">
      Projects
    </Button></Link>
    Copyright: Allan Hall inc. For questions or inquiries contact me at flashfantasy@outlook.com
    <Link to="/hobbies"><Button variant="contained" color="secondary">
      Interests
    </Button></Link>
    <Link to="/workhistory"><Button variant="contained" color="secondary">
      Work History
    </Button></Link>
    <Link to="/contactme"><Button variant="contained" color="secondary">
      Contact Me
    </Button></Link>

    </div>;
};

const NotFound = () => {
  return (
    <div>
      <h2>404 Page Not Found</h2>
    </div>
  )
}



function App() {
  return (
<BrowserRouter>
  <NavBar />
  <Switch>
  <Route exact path="/" component={Home} />
  <Route path="/aboutme" component={AboutMe} />
  <Route path="/projects" component={Projects} />
  <Route path="/hobbies" component={Hobbies} />
  <Route path="/workhistory" component={WorkHistory} />
  <Route path="/contactme" component={ContactMe} />
  <Route path='*' component={NotFound} />
  </Switch>
  <Footer />
</BrowserRouter>
  );
}

export default App;
